@churchandunioncharleston invited us to try their new menu and we really enjoyed it.  The atmosphere is especially cool inside with the stained glass windows and high ceilings. 
We loved the Meatballs with BBQ Glaze +Whipped Feta, the Truffled Caesar Salad and Homemade Braided Ravioli 💯🤌 So many other items we wanted to try but we were stuffed!

